import {chakra,HTMLChakraProps} from "@chakra-ui/react"
import React from "react";

type ContactImgProps = HTMLChakraProps<"svg"> & {
  idPrefix?: string; // optional manual prefix if you ever want to set it
};

const ContactImg: React.FC<ContactImgProps> = ({ idPrefix, ...props }) => {

  const autoId = React.useId().replace(/[^a-zA-Z0-9_-]/g, "");
  const uid = idPrefix ?? autoId;
    return (
        <chakra.svg 
        width="538px !important"
        height = "498px !important"
        viewBox="0 0 538 498"
        fill="none"
        {...props}>




<rect x="-79" width="751" height="498" fill={`url(#pattern_${uid})`}/>
<defs>
<pattern id={`pattern_${uid}`} patternContentUnits="objectBoundingBox" width="1" height="1">
<use href={`#image_${uid}`} xlinkHref={`#image_${uid}`} transform="matrix(0.000782418 0 0 0.00117891 -0.000747384 0)"/>
</pattern>
<image id={`image_${uid}`} width="1280" height="960" preserveAspectRatio="none" xlinkHref="data:image/png;base64,"/>
</defs>







        </chakra.svg>
    )
}

export default ContactImg;